import { Component, OnInit } from '@angular/core';
import {
  faDashboard,
  faLocation,
  faShop,
  faBox,
  faMoneyBill,
  faChartBar,
  faContactBook,
  faHand,
} from '@fortawesome/free-solid-svg-icons';

@Component({
  selector: 'app-side-nav',
  templateUrl: './side-nav.component.html',
  styleUrls: ['./side-nav.component.scss']
})
export class SideNavComponent implements OnInit {

  faDashboard = faDashboard;
  faLocation = faLocation;
  faShop = faShop;
  faBox = faBox;
  faMoneyBill = faMoneyBill;
  faChartBar = faChartBar;
  faContactBook = faContactBook;
  faHand = faHand;

  constructor() { }

  ngOnInit(): void {
  }

}
<div class="nav-items">
  <div class="nav-item">
    <a [routerLink]="['/transaction']">
      <fa-icon [icon]="faDashboard"></fa-icon>
      <span>Dashboard</span>
    </a>
  </div>
  <div class="nav-item">
    <fa-icon [icon]="faLocation"></fa-icon>
    <span>Locations</span>
  </div>
  <div class="nav-item">
    <fa-icon [icon]="faShop"></fa-icon>
    <span>Shops</span>
  </div>
  <div class="nav-item">
    <fa-icon [icon]="faBox"></fa-icon>
    <span>Products</span>
  </div>
  <div class="nav-item">
    <fa-icon [icon]="faMoneyBill"></fa-icon>
    <span>Sales</span>
  </div>
  <div class="nav-item">
    <fa-icon [icon]="faChartBar"></fa-icon>
    <span>Statistics</span>
  </div>
  <div class="nav-item">
    <fa-icon [icon]="faContactBook"></fa-icon>
    <span>Contact</span>
  </div>
  <div class="nav-item">
    <fa-icon [icon]="faHand"></fa-icon>
    <span>Help</span>
  </div>
</div>
